import React from 'react'
import Card from '@material-ui/core/Card';
import AddBoxIcon from '@material-ui/icons/AddBox';

const AddCard = ({ addCard }) => {
    return (
      <Box>
              <Card onClick={() => addCard()} minWidth='100%'>
        <AddBoxIcon />
      </Card> 

      </Box>
    )
}

export default AddCard
